import React,{useCallback, useEffect, useState} from "react";
import { useHttp } from "../hooks/http.hook";
import { useNavigate } from "react-router-dom";


export const MainPageCart = ({data}) => {
    const link = (id) =>{return "/apartmen/"+id;}

    return(
        <nav>
            <div class="nav-wrapper">
                <a href="" class="brand-logo">Logo</a>
                <ul id="nav-mobile" class="right hide-on-med-and-down">
                <li><a href="">sass</a></li>
                <li><a href="">sass <span class="new badge">4</span></a></li>
                <li><a href="">sass</a></li>
                </ul>
            </div>
        </nav>
    )

    /*
    {data.map(apartmen => (
                <a href = {link(apartmen.id)}><h1>{apartmen.id}</h1></a>
            ))}
    */
}

export const MainPage = () =>{
    const {request, loading} = useHttp();
    const [data, setData] = useState(null);
    const navigate =  useNavigate();

    const getDataAll = useCallback( async()=>{
        try
        {
            const fetched = await request('/api/all', 'GET', null,{});
            setData(fetched);
        }
        catch(e){}
    },[request]);

    useEffect(()=>{
        getDataAll();
    },[getDataAll]);

    return(
        <div>
            {!loading && data && <MainPageCart data={data}/>}
        </div>
    );
}
